<script lang="ts">
  import "$lib/gocaptcha.less"
  // import {Click, Rotate, Slide, SlideRegion, Button} from "./../../";
  import {Click, Rotate, Slide, SlideRegion, Button} from "$lib/index";

  let type = "default"

  const clickImage = "data:image/jpeg;base64,"
  const clickImage2 = "data:image/jpeg;base64,"
  const clickThumb = "data:image/png;base64,"

  const slideImage = "data:image/jpeg;base64,"
  const slideThumbImage = "data:image/png;base64,"

  const rotateImage = "data:image/png;base64,"
  const rotateThumb = "data:image/png;base64,"

  const clickData = {
    image: clickImage,
    thumb: clickThumb,
  }
  const clickEvents = {
    click(x: number, y: number): void {
      console.log("click >>>>>>>", x, y)
    },
    confirm(dots: any, clear: Function): void {
      console.log("dots >>>>>>>", dots)
      setTimeout(() => {
        clear()
      }, 100)
    },
    refresh(): void {
      console.log("refresh >>>>>>>")
      clickData.image = clickImage2
    },
    close(): void {
      console.log("close >>>>>>>")
    },
  }

  const slideData = {
    thumbX: 20,
    thumbY: 20,
    thumbWidth: 80,
    thumbHeight: 80,
    image: slideImage,
    thumb: slideThumbImage,
  }
  const slideEvents = {
    move(x: number, y: number): void {
      console.log("move >>>>>>>", x, y)
    },
    refresh(): void {
      console.log("refresh >>>>>>>")
      slideData.thumbX = 40
      slideData.thumbY = 60
      slideData.image = clickImage2
    },
    close(): void {
      console.log("close >>>>>>>")
    }
  }

  const slideRegionData = {
    thumbX: 20,
    thumbY: 20,
    thumbWidth: 80,
    thumbHeight: 80,
    image: slideImage,
    thumb: slideThumbImage,
  }
  const slideRegionEvents = {
    move(x: number, y: number): void {
      console.log("move >>>>>>>", x, y)
    },
    refresh(): void {
      console.log("refresh >>>>>>>")

      slideRegionData.thumbX = 40
      slideRegionData.thumbY = 60
      slideRegionData.image = clickImage2
    },
    close(): void {
      console.log("close >>>>>>>")
    }
  }

  const rotateData = {
    angle: 20,
    image: rotateImage,
    thumb: rotateThumb,
  }
  const rotateEvents = {
    rotate(angle: number): void {
      console.log("rotate >>>>>>>", angle)
    },
    refresh(): void {
      console.log("refresh >>>>>>>")
      rotateData.image = clickImage2
    },
    close(): void {
      console.log("close >>>>>>>")
    }
  }
</script>

<br/>
<br/>

<Click data={clickData} events={clickEvents}/>
<br/>

<Slide data={slideData} events={slideEvents}/>
<br />

<SlideRegion data={slideRegionData} events={slideRegionEvents}/>
<br />

<Rotate data={rotateData} events={rotateEvents}/>
<br />

<Button clickEvent={() => type="warn"} type={type}/>
